message = ''

def checkMarker(candidate):
    for j in range(len(candidate)):
        if candidate[j] in candidate[0:j] or candidate[j] in candidate[j+1:]:
            return False
    return True

for i in range(4, len(message)+1):
    if checkMarker(message[i-4:i]):
        break
        
print('Star 1: '+str(i))

for i in range(14, len(message)+1):
    if checkMarker(message[i-14:i]):
        break
    
print('Star 2: '+str(i))
